import React from 'react';
import Products from '../Products';
import Courses from '../Courses';
import AddCourse from '../Courses/AddCourse';
import AddProduct from '../Products/AddProduct';
import Tables from '../../Partials/Table/index';
const routes = [
	{
		path: '/',
		exact: true,
		component: () => {
			return <>Products Courses</>;
		},
	},
	{
		path: '/course',
		exact: true,
		component: Courses,
	},
	{
		path: '/product',
		exact: true,
		component: Products,
	},
	{
		path: '/course/add',
		exact: true,
		component: AddCourse,
	},
	{
		path: '/product/add',
		exact: true,
		component: AddProduct,
	},
	{
		path: '/table',
		exact: true,
		component: Tables,
	},
];

export default routes;
